import React from 'react'

type DropListPropsType = {
    nameOf: string
    collapsed: boolean
}

export function DropList(props: DropListPropsType) {

    return (
        <div>
            <DropListTitle value={props.nameOf} />
            <DropListBody
                one={'4/4'}
                two={'4/8'}
                three={'6/6'}
                four={'6/12'}
                five={'8/16'} />
        </div>
    )
}

type DropListTitlePropsType = {
    value: string
}

function DropListTitle(props: DropListTitlePropsType) {
    return (
        <><h3>{props.value}</h3></>
    )
}

type DropListBodyPropsType = {
    one: string
    two: string
    three: string
    four: string
    five: string
}

function DropListBody(props: DropListBodyPropsType) {
    return (
        <ul>
            <li><i>{props.one}</i></li>
            <li><i>{props.two}</i></li>
            <li><i>{props.three}</i></li>
            <li><i>{props.four}</i></li>
            <li><i>{props.five}</i></li>
        </ul>
    )
}
